// components/Header.js

import Link from 'next/link'
import Navbar from './Navbar.js'
import '../css/header.css';

const headerStyle = {
	marginBottom: 10,
	padding: 20,
	border: '1px solid #DDD'
}

const Header = () => (
	<div style={headerStyle}>
		<Navbar />
	</div>
)

export default Header
